import React from 'react';
import './App.css';
import Navbar from './components/Navbar';

function App() {
  return (
    <div className="App">
      <Navbar />
      <main className="main-content">
        <h1>Welcome to City College of Bayawan</h1>
        <p>This is the main content area of the portal.</p>
      </main>
    </div>
  );
}

export default App;
